import React from 'react'
import Labels from '../Labels.json'

console.log(Labels);

const Quotes = () => {
    return (
        <div>
          <h1>{Labels[0].quote}</h1>  
            <h1>{Labels[0].author}</h1>
        </div>
    );
};

export default Quotes;
